import React from "react";
import {
  Container,
  Text,
  PrimaryButton,
  SearchInput
} from "../../styledComponents";
import styled from "styled-components";

const SearchWrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  /* justify-content: space-between; */
  padding-right: 30px 110px;
  background-color: white;
`;
const Wrapper = styled(Container)`
  display: flex;
  width: 100%;
  flex-direction: row;
  flex-wrap: "wrap";
  justify-content: "space-around";
`;
const Houses = () => {
  return (
    <Container flex={1}>
      <SearchWrapper>
        <Container flex={1} color="transparent">
          <SearchInput
            placeholder="What house are you looking for?"
            customStyles={{ width: "70%" }}
          />
        </Container>

        <PrimaryButton customStyles={{ width: 150 }}>Search</PrimaryButton>
      </SearchWrapper>
      <Wrapper>
      {[{id:1,name:'Barcelona'}, {id:2}]}
      </Wrapper>
    </Container>
  );
};

export default Houses;
